    @Test
    void whenGetAirByNow_ThenCityShouldBeProvided(){
        City c1 = new City("40.528484","-8.7655525","Aveiro");

        String json = "{\"coord\":{\"lon\":-8.7656,\"lat\":40.5285},\"list\":[{\"main\":{\"aqi\":2},\"components\":{\"co\":193.6,\"no\":0.07,\"no2\":0.54,\"o3\":97.28,\"so2\":1.12,\"pm2_5\":1.79,\"pm10\":2.52,\"nh3\":0},\"dt\":1620651600}]}";

        Mockito.when(restTemplate.getForObject("http://api.openweathermap.org/data/2.5/air_pollution?lat=" + c1.getLat() + "&lon=" + c1.getLon() + "&appid=" + api1Key, String.class)).thenReturn(json);

        Air air = airQualityService.getAirByNow(c1);

        assertThat(air.getDate()).isEqualTo("10-05-2021");

    }

